import axios from "axios";

function getTimes(){
    try {
        return axios.get('/rest/dates');
    } catch (error) {
        console.error(error)
    }
}

function getKeywords(time){
    axios.get(`/rest/keywords?t=${time}`).then((Response) => {
        console.log(Response.data);
        return Response.data
    }).catch((Error) => {
        console.log(Error);
    })
}

function getNews(time, keywords){
    axios.get(`/rest/news?t=${time}&keywords=${keywords}`).then((Response) => {
        console.log(Response.data)
        return Response.data
    }).catch((Error) => {
        console.log(Error);
    })
}


export default {getTimes, getKeywords, getNews}
